import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { useHistory } from "react-router-dom";
import { createPokemon, getTypes } from "../../redux/actions";
import './Form.css';




export default function Form () {

    const dispatch = useDispatch();
    const types = useSelector(state => state.types)
    const [error, setError] = useState({})
    const history = useHistory();

    const [input, setInput] = useState({
        name: '', 
        hp: 0, 
        attack: 0, 
        defense: 0, 
        speed: 0,
        height: 0, 
        weight: 0, 
        types: [],
        img: ''
    })

    let noEmpty = /\S+/;
    let validateName = /^[a-z]+$/i;
    let validateNum = /^\d+$/;
    let validateUrl = /^(ftp|http|https):\/\/[^ "]+$/;

    const validate = (input) => {
        let error = {};
        if (!noEmpty.test(input.name) || !validateName.test(input.name) || input.name.length < 3) {
        error.name = "Name required. Only string of more than two characters and without numbers";
        }
        if (!validateNum.test(input.hp) || parseInt(input.hp) < 1 ) {
            error.hp = "Number required. Higher than one";
        }
        if (!validateNum.test(input.attack) || parseInt(input.attack) < 1) {
            error.attack = "Number required. Higher than one";
        }
        if (!validateNum.test(input.defense) || parseInt(input.defense) < 1) {
            error.defense = "Number required. Higher than one";
        }
        if (!validateNum.test(input.speed) || parseInt(input.speed) < 1) {
            error.speed = "Number required. Higher than one";
        }
        if (!validateNum.test(input.height) || parseInt(input.height) < 1) {
            error.height = "Number required. Higher than one";
        }
        if (!validateNum.test(input.weight) || parseInt(input.weight) < 1) {
            error.weight = "Number required. Higher than one";
        }
        if (!validateUrl.test(input.img)) {
        error.img = "URL is required";
        }

        return error;
    };

    const handleChange = (e) => {
        setInput({
            ...input,
            [e.target.name]: e.target.value

        });

        setError(validate({
            ...input,
            [e.target.name]:e.target.value
        }))
    }

    const handleSelect = (e) => {
        if(input.types.length < 2){
            setInput({
                ...input,
                types: [...input.types, e.target.value]
            })
            e.target.value = 'Select type';
        } else {
            alert('Two types of pokemon at most')
        }
    }

    const handleSubmit = (e) => {
        e.preventDefault();

        if(
            !error.name &&
            !error.hp &&
            !error.attack &&
            !error.defense &&
            !error.speed &&
            !error.height &&
            !error.weight &&
            !error.img 
        ) {
            dispatch(createPokemon(input));
            setInput({
                name: '', 
                hp: 0, 
                attack: 0, 
                defense: 0, 
                speed: 0,
                height: 0, 
                weight: 0, 
                types: [],
                img: ''

            });
            history.push('/home')
        } else {
            alert('Error. Check the form')
        }
    }

    useEffect(() => {
        dispatch(getTypes())
    },[dispatch])

    return(
        <form className="pokeform">
            <h2>Create Your Pokemon!!</h2>
            <label>Name:</label>
            <input value='text' placeholder="name" name='name'/>
            <label>HP:</label>
            <input value='number' placeholder="HP" name='hp'/>
            <label>Attack:</label>
            <input value='number' placeholder="Attack" name='attack'/>
            <label>Defense:</label>
            <input value='number' placeholder="Defense" name='defense'/>
            <label>Speed:</label>
            <input value='number' placeholder="Speed" name='speed'/>
            <label>Height:</label>
            <input value='number' placeholder="Height" name='height'/>
            <label>Weight:</label>
            <input value='number' placeholder="Weight" name='weight'/>
            <label>Image:</label>
            <input value='text' placeholder="Image" name='img'/>
        </form>
    )
}
